import Figure from 'react-bootstrap/Figure';
import '../css/Figura.css'
import january from'../img/january/january.png'

function January() {
  return (
    <Figure className='Figure'>
      <Figure.Image
        alt="171x180"
        src={january}
        
      />
      
    </Figure>
  );
}

// export default January;


function April() {
  return (
    <Figure className='Figure'>
      <Figure.Image
        alt="171x180"
        src={april}
        
      />
      
    </Figure>
  );
}

